  true,\n\t\"url\": null,\n\t\"notes\": \"Wind data collected from Tanana Village
  in Alaska from an anemometer as part of the Native American anemometer loan program.
  Monthly mean wind speed is available for 2001 through 2002, as is wind direction
  and turbulence data. Data is reported from a height of 20 m. The data was originally
  made available by Wind Powering America, a DOE Office of Energy Efficiency & Renewable
  Energy (EERE) program. A dynamic map displaying all available data from DOE anemometer
  loan programs is available http://www.windpoweringamerica.gov/anemometerloans/projects.asp.\",\n\t\"license_title\":
